import React, { Component } from 'react';
// import phonelogo from './phone-call.png';
import './App.css';
import CallWidget from './widget/CallWidget';

class App extends Component {
  constructor(props)  {
    super(props);
    this.state = {
      onValue: [],
      isClicked : false,
    }
  }

  imageClick = () => {
    console.log('Click');
  } 

  componentDidMount = () => {
    this.fetchPerson();
  }

  fetchPerson = () => {
    fetch("https://codifyinditest.com/script_test/api-test/")
    .then(data => data.json())
      .then(onValue => {
        this.setState({ onValue }, () => {
          console.log('bera',onValue);
        });  
      })
      .catch(error => {
        console.log(error);
    })
  }

  render(){
  return (
    <div className="App">
      <header className="App-header">
        <CallWidget/>
      </header>
    </div>
  );
}
}
export default App;
